import logo from './logo.svg';
import Dropdown from 'react-dropdown';
import chev from './images/chevron.svg';
import './Details.css'
import { useState } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

function Details() {

    const [notes, addNotes] = useState(["Inga anteckningar hittades"])

    function changeNotes(event){
      console.log(event)
      event.preventDefault();
      var temp = [notes]
      console.log(temp)
      temp.push(event.target[0].value)
      temp.map( (val, i) =>{
      <h3>{i + ". " + val}</h3>
      })
      addNotes(temp)
      
    }
    let { course } = useParams();
    let { type } = useParams();
    let { daysLeft } = useParams();

  return (
    <body>
      <div className="DETAILS_cont">
        <div className="DETAILS_linkTillbaka">
          <Link to="/home"> 
              <img className="DETAILS_chev" src={chev}/>
          </Link>
        </div>
        <div className="DETAILS_pageTitle">
          <h1>KURS: <span className="DETAILS_infospan">{course}</span></h1>
          <h1>TYP: <span className="DETAILS_infospan">{type}</span></h1>
          <h1>DAGAR: <span className="DETAILS_infospan">{daysLeft}</span></h1>
          <h4>Anteckningar:</h4>
        </div>
        <div className="DETAILS_notes">
            <h4>{notes}</h4>
        </div>
        <div className="DETAILS_note">
        <h2>Lägg till anteckning</h2>
        <div className="DETAILS_theform">
          <form className="DETAILS_form" onSubmit={changeNotes}>
            <input type="text"></input>
            <button type="submit">LÄGG TILL</button>
          </form>
        </div>
        </div>    
        
      </div>     
    </body>
  );
}

export default Details;
